snippet.sync_client:
package com.example.usage;

import com.seed.plainText.SeedPlainTextClient;

public class Example {
    public static void main(String[] args) {
        SeedPlainTextClient client = SeedPlainTextClient
            .builder()
            .build();

        client.service().getText();
    }
}

